import React from 'react';
import { ProjectsList } from '../helpers/ProjectsList';
import '../styles/Projects.css';
import ProjectItem from '../components/ProjectItem'

function Projects() {
    return (
        <div className="projects">
            <h1 className="projectsTitle">My Projects</h1>
            <div className="projectsList">{ProjectsList.map((projectItem, key) => {
                return < ProjectItem 
                key = {key}
                image={projectItem.image} 
                name ={projectItem.name} 
                year ={projectItem.year}/>
            })}
            </div>
            <h1 className="PySynth">PySynth</h1>
                <p></p>
            <h1 className="InstaBot">InstaBot</h1>
                <p></p>
            <h1 className="PatrolBotV1">PatrolBotV1</h1>
                <p></p>
            <h1 className="PatrolBotV2">PatrolBotV2</h1>
            <h1 className="I3DDemo">I3D Demo</h1>
            <h1 className="PatrolBotV3">PatrolBotV3</h1>
        </div>

    );
}

export default Projects;
